const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>The Traveling Blog</h1>
      <div className="links">
        <a href="/">Home</a>
        <a
          href="/create"
          style={{
            color: "White",
            backgroundColor: "#f1356d",
          }}
        >
          New blog
        </a>
      </div>
    </nav>
  );
};

export default Navbar;
